import React from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";
export default function Navbar() {
  return (
    <div className="navbar">
      <nav>
        <div className="nav-links">
          <Link to="/">Home</Link>
          <Link to="/adopt">Adopt</Link>
          <Link to="/shop">Shop</Link>
        </div>
      </nav>
    </div>
  );
}
